// CarList.js
import React from 'react';
import Car from '../Car/Car';
import './carsList.css'

const CarList = () => {
    const cars = [
        {
            name: "Women's black vest Gucci",
            description: "A shiny dress, a shiny dress, a shiny dress",
            price: 715,
            imageUrl: "https://example.com/image1.jpg"
        },
        {
            name: "Red dress Valentino",
            description: "A shiny dress in the style of Lady Gaga, for bright events and cool parties",
            price: 540,
            imageUrl: "https://example.com/image2.jpg"
        },
        {
            name: "Shiny dress Givenchy",
            description: "A shiny dress, a shiny dress, a shiny dress, here is a good weather and so on",
            price: 1610,
            imageUrl: "https://example.com/image3.jpg"
        },
    ];

    return (
        <div className="car-list">
            {cars.map((car, index) => (
                <Car key={index} {...car} />
            ))}
        </div>
    );
};

export default CarList;
